import PositionImg from '../Images/position-property.jpg';

const BlogData = [
    {
        Title: 'Position Property in CSS',
        Image: PositionImg,
        Link: 'https://webhelp-ui.netlify.app/',
    },
    {
        Title: 'ToDoList',
        Image: PositionImg,
        Link: 'https://niketvns.github.io/ToDoList/',
    },
    {
        Title: 'Keep Note',
        Image: PositionImg,
        Link: 'https://niketvns.github.io/keep-note/',
    }
]

export default BlogData;
